import { Container, Row } from 'react-bootstrap';


class Quality extends Component {
    render() {
      return (
          <Container className="text-center">
            <h2>{this.props.title}</h2>
            <p>{this.props.desc}</p>
            <img style={{width: "100%"}} src={this.props.image}/>
          </Container>
      );
    }
  }

  export default Quality;
